import { Link, NavLink } from "react-router-dom";

const HeaderMenu = ({ setContactShow }) => {
  return (
    <ul>
      <li>
        <NavLink
          to="/"
          activeClassName="active"
          onClick={() => {
            setContactShow(true);
          }}
        >
          INICIO
        </NavLink>
      </li>
      <li>
        <Link
          to="/series"
          onClick={() => {
            setContactShow(true);
          }}
        >
          SERIES
        </Link>
      </li>
      <li>
        <Link
          to="/cinetv"
          onClick={() => {
            setContactShow(true);
          }}
        >
          CINE/TV
        </Link>
      </li>
      <li>
        <Link
          to="/teatro"
          onClick={() => {
            setContactShow(true);
          }}
        >
          TEATRO
        </Link>
      </li>
      <li>
        <Link
          to="/teatro"
          onClick={() => {
            setContactShow(true);
          }}
        >
          MÃšSICA
        </Link>
      </li>
      <li>
        <Link
          to="/fotos"
          onClick={() => {
            setContactShow(true);
          }}
        >
          FOTOS
        </Link>
      </li>
      <li>
        <Link
          to="/cv"
          onClick={() => {
            setContactShow(true);
          }}
        >
          CV
        </Link>
      </li>
      <li>
        <Link
          to="/contacto"
          onClick={() => {
            setContactShow(false);
          }}
        >
          CONTACTO
        </Link>
      </li>
    </ul>
  );
};
export default HeaderMenu;
